INSERT INTO products (user_id, title, description, thumbnail_photo_url, price, category)
VALUES (3, 'Custom Mechanical Keyboard', 'Primus75 board, DSA Galactic Empire keycaps, Gazzew Boba U4T switches with a 62g actuation force, an aluminum plate in red, TX Rev 2 stabilizers, and a custom black anodized middle piece.', 'https://preview.redd.it/7z2jbmf7rtxa1.jpg?width=4080&format=pjpg&auto=webp&v=enabled&s=5432e44945c19aff600e0ea189aea2b54d8cdf0f', 700.00, 'Gaming');

INSERT INTO products (user_id, title, description, thumbnail_photo_url, price, category)
VALUES (3, 'Sagittarius with GMK Civilizations and Lazurite', 'The Sagittarius keyboard features U4T stems fitted into Cherry housings, with TX XL 60g springs and 3204-lubed stems. It also has a brass plate and TX stabilizers. The keycaps are GMK Civilizations with the addition of GMK Lazurite Gold High Renaissance Novelties, adding a touch of luxury to the overall aesthetic of the keyboard.', 'https://preview.redd.it/adhtdbku8hxa1.jpg?width=4032&format=pjpg&auto=webp&v=enabled&s=75917de2a1b88a968c3cf9ffc299b9bd849dc78b', 745.33, 'Gaming');

