INSERT INTO products (user_id, title, description, thumbnail_photo_url, price, category)
 VALUES (3, 'TX EO-87', 'The Alpacas keyboard switches have been customized with Krytox 205g0 lubricant applied to both the housing and stem, and GPL 105 on the springs, with the addition of Deskeys switch films. The switches are also fitted with 63.5g Sprit Slow springs for a comfortable typing experience. The keyboard features a Chocobo Brass plate and Durock stabilizers, enhancing the overall durability and stability of the switches. The keycaps are GMK Minimal, giving the keyboard a sleek and minimalist look.', 'https://i.redd.it/wo083uwuc1061.jpg', 659.34, 'Gaming');

